      }
      .element {
        position: absolute;
        transform-origin: top left;
      }
      .content-wrapper {
        width: 100%;
        height: 100%;
        position: relative;
        display: flex;
        align-items: center;
        justify-content: center;
      }
      .element.text {
        white-space: pre-wrap;
        word-break: break-word;
        padding: 5px;
        display: flex;
        align-items: center;
      }
      .element.image img {
        width: 100%;
        height: 100%;
        object-fit: cover;
      }
      .element.rect {
        background-color: #ffffff;
        border: 1px solid #000000;
      }
      
      /* Animações */
      @keyframes fadeIn {
        from { opacity: 0; }
        to { opacity: 1; }
      }
      
      @keyframes slideInLeft {
        from { transform: translateX(-50px); opacity: 0; }
        to { transform: translateX(0); opacity: 1; }
      }
      
      @keyframes slideInRight {
        from { transform: translateX(50px); opacity: 0; }
        to { transform: translateX(0); opacity: 1; }
      }
      
      @keyframes slideInTop {
        from { transform: translateY(-50px); opacity: 0; }
        to { transform: translateY(0); opacity: 1; }
      }
      
      @keyframes slideInBottom {
        from { transform: translateY(50px); opacity: 0; }
        to { transform: translateY(0); opacity: 1; }
      }
      
      @keyframes zoomIn {
        from { transform: scale(0.5); opacity: 0; }
        to { transform: scale(1); opacity: 1; }
      }
      
      @keyframes bounce {
        0%, 20%, 50%, 80%, 100% { transform: translateY(0); }
        40% { transform: translateY(-30px); }
        60% { transform: translateY(-15px); }
      }
      
      @keyframes pulse {
        0% { transform: scale(1); }
        50% { transform: scale(1.1); }
        100% { transform: scale(1); }
      }
      
      .animate {
        animation-fill-mode: both;
      }
      
      .animation-fade-in { animation-name: fadeIn; }
      .animation-slide-left { animation-name: slideInLeft; }
      .animation-slide-right { animation-name: slideInRight; }
      .animation-slide-top { animation-name: slideInTop; }
      .animation-slide-bottom { animation-name: slideInBottom; }
      .animation-zoom-in { animation-name: zoomIn; }
      .animation-bounce { animation-name: bounce; }
      .animation-pulse { animation-name: pulse; }
      
      .duration-1 { animation-duration: 0.5s; }
      .duration-2 { animation-duration: 1s; }
      .duration-3 { animation-duration: 1.5s; }
      .duration-4 { animation-duration: 2s; }
      .duration-5 { animation-duration: 2.5s; }
      
      .delay-0 { animation-delay: 0s; }
      .delay-1 { animation-delay: 0.2s; }
      .delay-2 { animation-delay: 0.4s; }
      .delay-3 { animation-delay: 0.6s; }
      .delay-4 { animation-delay: 0.8s; }
      .delay-5 { animation-delay: 1s; }
      
      .timing-linear { animation-timing-function: linear; }
      .timing-ease { animation-timing-function: ease; }
      .timing-ease-in { animation-timing-function: ease-in; }
      .timing-ease-out { animation-timing-function: ease-out; }
      .timing-ease-in-out { animation-timing-function: ease-in-out; }
      
      .iteration-1 { animation-iteration-count: 1; }
      .iteration-2 { animation-iteration-count: 2; }
      .iteration-3 { animation-iteration-count: 3; }
      .iteration-infinite { animation-iteration-count: infinite; }
    
  </style>
